import React from "react";
import { MapContainer, Marker, Popup, TileLayer, useMap } from 'react-leaflet'

import LinkToMap from "../LinkToMap";

const LOCATION = [36.32787631122742, 127.42585033518178];

const SearchLeafletMap = () => {

    return (
        <div >
                <MapContainer center={LOCATION} zoom={13} scrollWheelZoom={false} style={{height:'300vh'}} >
                    <TileLayer
                    attribution='&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'
                    url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
                    />
                    <Marker position={LOCATION}>
                    <Popup>
                        A pretty CSS3 popup. <br /> Easily customizable.
                    </Popup>
                    </Marker>
                </MapContainer>

        </div>
    )
}

export default SearchLeafletMap;
